import { Routes } from 'react-router-dom';
import './App.css';
import MainPage from './components/MainPage/MainPage';

function App() {
  return (
    <div className="App">
      <Routes>
      <Route path="/main-page" element={<MainPage />} />

      </Routes>
    </div>
  );
}

export default App;
